bio:
*Построила карьеру в стратегическом управлении и бизнес-аналитике, работая с крупнейшими игроками телеком-рынка;
 *Управляю командами и внедряю цифровые решения, которые повышают эффективность бизнеса;
 *Постоянно обучаюсь (ML, Data Science, Project Management) и внедряю передовые практики;
 *Выступала на международных форумах, участвовала в стратегических сессиях, побеждала в корпоративных конкурсах;
*Грант в London Business School за лучший бизнес-кейс;
 *Корпоративная награда "Признание" в Ростелеком за вклад в развитие компании;
 * Победитель конкурса "Лучшая бизнес-идея" в международной риелторской компании.

Читаю книги по бизнесу, стратегии и аналитике. Занимаюсь спортом

- Over 24 years of Civil & Structural Engineering experience;
- Carried out structural design and calculation of concrete, steel and mixed structures including Oil & Gas facilities, Sky-scrappers, Business centers, Industrial, Residential, Sport buildings and structures;
- Experience of project planning and coordination;
- Long term working experience in a multinational environment; experience of collaboration with world 
  leading Construction, Architectural and Engineering companies;
- Design experience according to Russian, European and American Building codes;
- Experience of passing Russian state expertise;
- BIM design, Revit API, .Net, Java, C++, Python, SQL, Data Analysis

•Skilled in functional, regression testing, Test Case and Test Plan creation, reporting bugs; 
•Enjoy working in Agile environment;
•Understanding of the startup spirit, culture and goals; 
•Enjoy learning new technologies and challenging concepts; 
•Understanding of SDLC; 
•Good organizational and time-management skills; •Analytical skills and attention to details. 

 *Skilled in: IntelliJ IDEA, Selenium, Maven, TestNG, Jenkins, Jira, Trello, SQL, Postman, HTML, CSS, JS, Java.
